import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
        width: '100%',
        padding: '10px',
    
    },

    button: {
        backgroundColor: 'white',
        height: '40px',
        justifyContent: 'center',
        alignItems: 'center',
        borderRadius: 20,
    },

    text: {
        color: 'black',
        fontSize: 12,
        fontWeight: '500',
        textTransform: 'uppercase',
    }
});

export default styles;
